INSERT INTO weibo.weibo_cand (id, url, content, wb_from) VALUES (22, 'https://weibo.com/3186945861/G2P2Az2M8', '【老人快摔下时被一把抱住：你已不是第一次救我】2月11日，@武汉地铁运营 6号线马鹦路站，一老人乘坐电扶梯时没站稳，即将摔倒之际，立刻被身后的地铁工作人员黄婷冲上来撑住。原来，她从出站口就注意到了这位老人，担心其安全就一直“粘”在他身后，护送他出站。老人出站后，感动得不停向她鞠躬 ...展开全文c[心]', '武汉地铁运营');
