INSERT INTO weibo.weibo_cand (id, url, content, wb_from) VALUES (30, 'https://weibo.com/3229125510/G2OWMEdvL', '生在一个安稳的家庭，儿时没受过虐待或校园暴力，基本上身心健康地成长，长大后也没有遇到特别恶劣的渣男渣女，三观没歪。头脑一般，考了个差不多的学校，找了一份能养活自己的工作，和一个普通的人组建了一个安稳的小家，一辈子没遇到什么飞来横祸...听起来再平常不过，然而走起来才知道有多难。', '小野妹子学吐槽');
INSERT INTO weibo.weibo_cand (id, url, content, wb_from) VALUES (31, 'https://weibo.com/1192966660/G2UZODmHH', '过年了，给发现花了198洗个车……回忆了下从去年10月到现在一直没洗车……一年洗了也没5次，一年跟我跑了好多地方，雅丹沙漠跑了两次，辛苦了。大家过节好。[允悲]', '韩路');
INSERT INTO weibo.weibo_cand (id, url, content, wb_from) VALUES (32, 'https://weibo.com/2280198017/G2TzDbdxV', '【2018，有我们在，请祖国人民安过年】逝者如斯夫，2018年的新春敲响了来临的钟声。夜晚，各地的广场上烟花绽放，平日里黑灯瞎火的城镇也热闹非凡，一切幸福祥和，美满如斯。可军人的夜空却是单调的，黑暗里只有星星相伴，为了祖国人民的安宁，他们无怨也无悔，2018，依然为您守岁！（罗鑫 胡辉）[心]', '军报记者');
INSERT INTO weibo.weibo_cand (id, url, content, wb_from) VALUES (33, 'https://weibo.com/2614543117/G2FkubplB', '某航班需承运一名病重战士，需要占用9个座位，我自愿改签一分钱都不要，多名乘客自愿改签。为正能量打call，岁月静好，只因有人负重前行。感谢有你们，致敬中国军人。', '最全热门排行榜');
